import React from 'react'
import './Chart.css'
import { AreaChart , Area, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';
import { useState } from 'react';
function Chart(props) {
    const monthNames = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
    const currentDate = new Date();
    const currentMonth = currentDate.getMonth() + 1;
    const currentMonthName = monthNames[currentMonth - 1]; 

    const [month, setMonth] = useState(currentMonthName);
    const initialDate = [
        {
            "name": "5k",
            "pv": props.month.five,
        },
        {
            "name": "10k",
            "pv": props.month.ten,
        },
        {
            "name": "15k",
            "pv": 20,
        },
        {
            "name": "20k",
            "pv": 20,
        },
        {
            "name": "25k",
            "pv": 20,
        },
        {
            "name": "30k",
            "pv": 20,
        },
        {
            "name": "35k",
            "pv": 20,
        },
        {
            "name": "40k",
            "pv": 20,
        },
        {
            "name": "45k",
            "pv": 20,
        },
        {
            "name": "50k",
            "pv": 20,
        },
        {
            "name": "55k",
            "pv": 20,
        },
        {
            "name": "60k",
            "pv": 20,
        }
    ]
    const [data, setData] = useState(initialDate);
    useEffect(() => {
        const newData = [
            {
                "name": "5k",
                "pv": props.month.five,
            },
            {
                "name": "10k",
                "pv": props.month.ten,
            },
            {
                "name": "15k",
                "pv": 20,
            },
            {
                "name": "20k",
                "pv": 20,
            },
            {
                "name": "25k",
                "pv": 20,
            },
            {
                "name": "30k",
                "pv": 20,
            },
            {
                "name": "35k",
                "pv": 20,
            },
            {
                "name": "40k",
                "pv": 20,
            },
            {
                "name": "45k",
                "pv": 20,
            },
            {
                "name": "50k",
                "pv": 20,
            },
            {
                "name": "55k",
                "pv": 20,
            },
            {
                "name": "60k",
                "pv": 20,
            }
        ] 
        setData(newData);
    }, [month]);
    const handleChange = (event) => {
        setMonth(event.target.value);
    };
  return (
    <div className='chart'>
        <div className='chart_header'>
          <h1 className='chart_title'>DÃ©tailles des ventes
          </h1>
            <div className='select_container'>
              <select value={month} onChange={handleChange} className='chart_select'>
                  <option value="January">January</option>
                  <option value="February">February</option>
                  <option value="March">March</option>
                  <option value="April">April</option>
                  <option value="May">May</option>
                  <option value="June">June</option>
                  <option value="July">July</option>
                  <option value="August">August</option>
                  <option value="September">September</option>
                  <option value="October">October</option>
                  <option value="November">November</option>
                  <option value="December">December</option>
              </select>
            </div>
        </div>
        <AreaChart width={1050} height={360} data={data}
            margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
            <defs>
                <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
                    <stop offset="5%" stopColor="#019ADD" stopOpacity={0.4} />
                    <stop offset="95%" stopColor="#019ADD" stopOpacity={0} />
                </linearGradient>
            </defs>
            <XAxis dataKey="name" className='tick-labels' />
            <YAxis
                ticks={[20, 40, 60, 80, 100]}
                tickFormatter={(value) => `${value}%`}
                className='tick-labels'
            />
            <CartesianGrid vertical={false} strokeWidth={0.4}/>
            <Tooltip />
            <Area type="monotone" dataKey="pv" stroke="#019ADD" fillOpacity={1} fill="url(#colorPv)" dot={{ stroke: '#019ADD', strokeWidth: 2, fill: '#019ADD' }} />
        </AreaChart>

    </div>
  )
}

export default Chart
